import React, { Component } from 'react';
import axios from 'axios';
import logo from './logo.svg';
import './App.css';

const api = axios.create({
  baseURL: `http://www.devcodecampmusiclibrary.com/api/music`
})

class App extends Component {

  state = {
    musicCollection:[]
  }

  constructor() {
    super();
    api.get('/').then(response => {
      console.log(response.data)
      this.setState({ musicCollection: response.data})
    })
  }


  render(){
    return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <h3 className="display-1">Music Library Search</h3>
    {this.state.musicCollection.map(music => <h2 key={music.id}>{music.title}</h2>)}
        <a
          className="App-link"
          href="https://reactjs.org"
          target="_blank"
          rel="noopener noreferrer"
        >
          Learn React
        </a>
      </header>
    </div>
    )};
}

export default App;
